Here is the translation:

Greetings eternal ancestors, greetings all Shyam's strengths; 
Greetings letters' control, greetings virtues' virtuous ones.

Here is the translation:

Praise the embodiment of Lord's incarnation, praise the blissful saints; 
Praise the friends of poor and merciful, praise the devotees who take care of others.

Here is the translation:

Greetings to the noble warrior, greetings to the brave one till death; 
Greetings to Raghunath Ramchandra, greetings to Raghu in happiness and ocean.

Here is the translation:

Greetings Ram with royal vision, greetings noble-minded Raja;
Greetings Vamanji, all-encompassing Lord, greetings embodiment of the universe, sustainer of the universe.

Here is the translation:

Hail Yogesh life breath, Hail Yasodanand sojourn;
Hail Yamuna riverbank, Hail complete artistry twenty-five.

Namashri Hariji Shalagrama, shuddha Shankachakradhar naam;
Namoshura surasada sev, namo Sadhu Vallabhabhav.

(Adapted from the original Gujarati text)

Note: The couplet is a form of worship or homage to Lord Krishna, and it means:

"Salutations to Shalagrama, the pure and sacred name of Lord Hari; 
Salutations to the eternal service of the divine, and salutations to the blessed state of the devotees."
